Soft glam makeup tutorial🫶🏻 Would you believe me if I told you this takes me 15 minutes?🤭 I’ve been doing this routine for the past 6 months and all of these products work so well for me! I also have acne prone skin so it’s been amazing to be able to have a solid routine that keeps my skin clear🤍

Makeup used:
@milkmakeup mattifying primer
@benefitcosmetics porefessional primer
@charlottetilbury flawless filter (shade 2)
@rarebeauty under eye brightener (shade light)
@esteelauder double wear foundation (shade 2N2)
@hourglasscosmetics vanish concealer (shade silk)
@nyxcosmetics thick it stick it brow gel (espresso)
@rarebeauty bronzer (shade happy sol)
@rarebeauty liquid blush (happy)
@charlottetilbury flawless powder (shade 2)
@beautyblender powder puff
@patrickta bronzer duo (shade she’s sculpted)
@fentybeauty pro filter powder (shade butter)
@makeupbymario crystal reflector (shade bronzite)
@makeupbymario eyeliner (shade soft brown)
@tartecosmetics tubing mascara
@maybelline eyeliner (shade white)
@patrickta blush duo (shade she’s that girl)
@makeupbymario highlighter (shade golden)
@makeupforever lip liner (shade 606)
@benefitcosmetics benetint
@toofaced lip plumping gloss (shade pink punch)
.
